import styled from 'styled-components';

export const Background = styled.header`
background-color:#d3d3d3;
border-bottom: 1px solid #b3b1b1;
`;

export const cover = {
    width: 600,
    height: '100%',
    overflow: 'hidden',
    WebkitMaskBoxImage: '-webkit-linear-gradient(left, transparent, white 50%, transparent)',
};

export const navbar = {
    height: 70,
    position: 'fixed',
    left: 0,
    top: 0,
    width: '100%',
    backgroundColor: '#222',
    display: 'flex',
    justifyContent: 'center',
};

export const navs = {
    margin: 0,
    paddingLeft: 0,
    position: 'relative',
    height: '100%',
    display: 'flex',
    listStyle: 'none',
};
